  return (
    <h1>{props.course}</h1>
  )
}

const Content = (props) => {
  return (
    <div>
      <Part exerciseName={props.part1} exerciseCount={props.exercises1} />
      <Part exerciseName={props.part1} exerciseCount={props.exercises1} />
    </div>
  )
}

const Part = (props) => {
  return (
    <>
      <p>
        {props.exerciseName + props.exerciseCount}
      </p>
    </>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises {props.exercises1 + props.exercises2 + props.exercises3}</p>
  )
}

