      exercises1={exercises1} 
      part2={part2} 
      exercises2={exercises2} 
      part3={part3} 
      exercises3={exercises3} />
      <Total exercises1={exercises1} exercises2={exercises2} exercises3={exercises3} />
    </div>
  )
}

export default App
